        method='get'
        accept='application/json'
        verbose={true}
      >
        {
          ({error, result, loading}) => {
            if (loading) {
              return <div>loading...</div>;
            } else {
              return <div>{ JSON.stringify(result) }</div>;
            }
          }
        }
      </Request></DropdownItem>


          <DropdownItem>Patients en attente</DropdownItem>
          <DropdownItem>Tous les patients  </DropdownItem>
        </DropdownMenu>
      </Dropdown>
    );
  }
}
